contracts/PropertyReservation.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;
import "./PropertyManagement.sol";

contract PropertyReservation {
    // Referință către contractul de administrare a proprietăților
    PropertyManagement public propertyManagement;
    struct Booking {
        uint256 id;
        uint propertyId;
        uint startDate;
        uint endDate;
        uint price;
        address bookerAddr;
    }

    // Evenimente
    event ReservationCreated(address indexed user, uint propertyId);
    mapping(uint => Booking) public bookings;
    uint256 public bookingCount;

    // Constructor - inițializează contractul cu referința către contractul de administrare a proprietăților
    constructor(PropertyManagement _propertyManagement) {
        propertyManagement = _propertyManagement;
    }

    // Modifier pentru a restricționa accesul doar pentru utilizatorii autentificați
    modifier onlyAuthenticated() {
        require(msg.sender != address(0), "User not authenticated.");
        _;
    }

    // Funcție pentru rezervarea unei proprietăți
    function reserveProperty(uint _propertyId, uint startDate, uint endDate) external onlyAuthenticated {
        require(startDate <= endDate, "Invalid period: start date must be before end date");

        PropertyManagement.Property memory property = propertyManagement.getProperty(_propertyId);
        for (uint256 i = 0; i < property.bookedPeriods.length; i++) {
            PropertyManagement.Period memory period = property.bookedPeriods[i];
            if ((startDate <= period.endDate) && (endDate >= period.startDate)) {
                revert("Property is already booked during this period");
            }
        }

        propertyManagement.bookProperty(_propertyId, startDate, endDate);

        uint256 totalDays = (endDate - startDate) / 1 days + 1;
        uint256 totalPrice = totalDays * property.pricePerNight;

        // Increment booking count and create the booking
        bookingCount += 1;
        bookings[bookingCount] = Booking({
            id: bookingCount,
            propertyId: _propertyId,
            startDate: startDate,
            endDate: endDate,
            price: totalPrice,
            bookerAddr: msg.sender
        });

        // Creăm rezervarea
        emit ReservationCreated(msg.sender, _propertyId);
    }
}

contracts/PropertyManagement.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract PropertyManagement {
    struct Period {
        uint256 startDate;
        uint256 endDate;
    }

    struct Property {
        uint256 id;
        address owner;
        string name;
        int256 latitude;
        int256 longitude;
        string description;
        uint256 pricePerNight;
        Period[] bookedPeriods;
    }

    event PropertyAdded(
        uint256 indexed id,
        address indexed owner,
        string location
    );
    event PropertyRemoved(uint256 indexed id, address indexed owner);

    mapping(uint256 => Property) public properties;
    uint256 public nextPropertyId;

    // Modifier to allow only the owner of the property to execute a function
    modifier onlyOwner(uint256 _propertyId) {
        require(
            properties[_propertyId].owner == msg.sender,
            "You are not the owner of this property."
        );
        _;
    }

    // Modifier to check if property ID is valid
    modifier validPropertyId(uint256 _propertyId) {
        require(_propertyId < nextPropertyId, "Invalid property ID");
        _;
    }

    function addProperty(
        string memory _name,
        string memory _description,
        uint256 _pricePerNight,
        int256 _latitude,
        int256 _longitude
    ) external {
        Property storage p = properties[nextPropertyId];
        p.id = nextPropertyId;
        p.owner = msg.sender;
        p.name = _name;
        p.latitude = _latitude;
        p.longitude = _longitude;
        p.description = _description;
        p.pricePerNight = _pricePerNight;

        emit PropertyAdded(nextPropertyId, msg.sender, _name);
        nextPropertyId++;
    }

    function bookProperty(uint256 propertyId, uint256 startDate, uint256 endDate) external {
        properties[propertyId].bookedPeriods.push(Period({
            startDate: startDate,
            endDate: endDate
        }));
    }

    // Function to "remove" a property by marking it as unavailable and resetting its data
    function removeProperty(uint256 _propertyId)
        external
        onlyOwner(_propertyId)
        validPropertyId(_propertyId)
    {
        emit PropertyRemoved(_propertyId, msg.sender);
        delete properties[_propertyId];
        nextPropertyId--;
    }

    function getProperty(uint256 _propertyId)
        external
        view
        returns (Property memory)
    {
        return properties[_propertyId];
    }
}

